import streamlit as st
import pandas as pd
import os
import re
from io import BytesIO
from openpyxl import load_workbook
from openpyxl.utils import get_column_letter
from openpyxl.styles import Font, Alignment

# Lista das disciplinas (baseada nos seus scripts)
disciplinas = [
    'ARTE', 'BIOLOGIA', 'EDUCAÇÃO FÍSICA', 'FILOSOFIA', 'FÍSICA', 'GEOGRAFIA',
    'HISTÓRIA', 'LÍNGUA INGLESA', 'LÍNGUA PORTUGUESA', 'MATEMÁTICA',
    'PRÁTICAS DE MAT E CNT NO TERRITÓRIO', 'PRÁTICAS DE LGG E CHS NO TERRITÓRIO',
    'PROJETO DE VIDA', 'QUÍMICA', 'SOCIOLOGIA',
    'TEMAS DE APROFUNDAMENTO MAT E CNT', 'TEMAS DE APROFUNDAMENTO LGG E CHS'
]

def inserir_titulo(ws, titulo):
    ws.insert_rows(1)
    ws['A1'] = titulo
    ws['A1'].font = Font(bold=True, size=14)
    ws['A1'].alignment = Alignment(horizontal='center')

    max_col = ws.max_column
    if max_col > 1:
        ws.merge_cells(start_row=1, start_column=1, end_row=1, end_column=max_col)

def ajustar_largura_colunas(worksheet):
    for i, col in enumerate(worksheet.columns, 1):
        max_length = 0
        for cell in col:
            try:
                if cell.value:
                    max_length = max(max_length, len(str(cell.value)))
            except:
                pass
        column_letter = get_column_letter(i)
        worksheet.column_dimensions[column_letter].width = max_length + 2

def extrair_codigo_turma(arquivo_upload):
    """Extrai o código da turma da célula A3"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=None, nrows=3)
        texto = str(df.iloc[2, 0])
        # Procura por padrão "turma CODIGO."
        match = re.search(r'turma ([A-Z0-9]+)\.', texto)
        if match:
            return match.group(1)
        else:
            return "Turma_Desconhecida"
    except Exception:
        return "Turma_Desconhecida"

def count_low_grades(arquivo_upload):
    """Baseado no script count_low_grades.py"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=[7,8])

        if df.empty:
            return None, "Arquivo está vazio"

        # Encontrar coluna do estudante
        nome_col = [c for c in df.columns if 'ESTUDANTE' in str(c[0]).upper()]
        if nome_col:
            df_alunos = df[df[nome_col[0]].notna() & (df[nome_col[0]].astype(str).str.strip() != '')].copy()
        else:
            df_alunos = df.copy()

        if df_alunos.empty:
            return None, "Nenhum aluno encontrado"

        resumo = []

        for disc in disciplinas:
            col = None
            for c in df_alunos.columns:
                if disc == str(c[0]).upper().strip() and '1' in str(c[1]):
                    col = c
                    break

            if col is not None:
                notas = df_alunos[col]
                abaixo_6 = notas.apply(lambda x: pd.notna(x) and isinstance(x, (int, float)) and x < 6).sum()
                sem_nota = notas.isna().sum() + (notas.astype(str).str.strip() == '').sum()

                resumo.append({
                    'Disciplina': disc,
                    'Alunos com nota < 6': abaixo_6,
                    'Alunos sem nota': sem_nota
                })

        df_resumo = pd.DataFrame(resumo)
        return df_resumo, None

    except Exception as e:
        return None, f"Erro ao processar: {e}"

def contar_disciplinas_por_aluno(arquivo_upload):
    """Baseado no script contar_disciplinas.py"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=[7,8])

        # Encontrar colunas de número e nome do aluno
        num_col = None
        nome_col = None
        for c in df.columns:
            if 'Nº' == str(c[0]).strip():
                num_col = c
            if 'ESTUDANTE' in str(c[0]).upper():
                nome_col = c

        if num_col is None or nome_col is None:
            return None, "Colunas 'Nº' ou 'ESTUDANTE' não encontradas"

        # Filtrar linhas válidas
        df_alunos = df[df[nome_col].notna() & (df[nome_col].astype(str).str.strip() != '')].copy()

        # Encontrar colunas do 1º bimestre
        colunas_1b = []
        for disc in disciplinas:
            for c in df_alunos.columns:
                if disc == str(c[0]).upper().strip() and '1' in str(c[1]):
                    colunas_1b.append((disc, c))
                    break

        def contar_notas_baixas(row):
            count = 0
            disciplinas_baixas = []
            for disc, col in colunas_1b:
                val = row[col]
                if pd.notna(val):
                    try:
                        if float(val) < 6.0:
                            count += 1
                            disciplinas_baixas.append(disc)
                    except:
                        pass
            return count, ', '.join(disciplinas_baixas)

        resultados = df_alunos.apply(contar_notas_baixas, axis=1)
        contagem = resultados.apply(lambda x: x[0])
        nomes_disciplinas = resultados.apply(lambda x: x[1])

        df_resumo = pd.DataFrame({
            'Nº': df_alunos[num_col],
            'Estudante': df_alunos[nome_col],
            'Notas Baixas': contagem,
            'Disciplinas com Notas Baixas': nomes_disciplinas
        })

        return df_resumo, None

    except Exception as e:
        return None, f"Erro ao processar: {e}"

def verificar_disciplinas_sem_nota(arquivo_upload):
    """Baseado no script verifica_notas.py"""
    try:
        arquivo_upload.seek(0)
        df = pd.read_excel(arquivo_upload, header=[7,8])
        disciplinas_sem_nota = []

        for disc in disciplinas:
            col = None
            for c in df.columns:
                if disc == str(c[0]).upper().strip() and '1' in str(c[1]):
                    col = c
                    break

            if col is not None:
                # Verifica se há algum valor numérico na coluna
                tem_nota = df[col].notna().any()
                if not tem_nota:
                    disciplinas_sem_nota.append(disc)

        return disciplinas_sem_nota, None

    except Exception as e:
        return None, f"Erro ao processar: {e}"

def processar_arquivo(arquivo_upload):
    """Processa um único arquivo e retorna todos os resultados"""
    codigo_turma = extrair_codigo_turma(arquivo_upload)

    # Análise 1: Resumo por disciplina
    df_resumo1, erro1 = count_low_grades(arquivo_upload)

    # Análise 2: Resumo por aluno
    df_resumo2, erro2 = contar_disciplinas_por_aluno(arquivo_upload)

    # Análise 3: Disciplinas sem nota
    disciplinas_sem_nota, erro3 = verificar_disciplinas_sem_nota(arquivo_upload)

    return {
        'codigo_turma': codigo_turma,
        'arquivo_nome': arquivo_upload.name,
        'resumo_disciplina': df_resumo1,
        'resumo_aluno': df_resumo2,
        'disciplinas_sem_nota': disciplinas_sem_nota,
        'erros': [erro1, erro2, erro3]
    }

def criar_excel_multiplas_turmas(resultados_turmas):
    output = BytesIO()

    with pd.ExcelWriter(output, engine='openpyxl') as writer:
        for resultado in resultados_turmas:
            codigo_turma = resultado['codigo_turma']

            if resultado['resumo_disciplina'] is not None:
                nome_aba = f"{codigo_turma}_Disciplinas"[:31]
                resultado['resumo_disciplina'].to_excel(writer, sheet_name=nome_aba, index=False)

            if resultado['resumo_aluno'] is not None:
                nome_aba = f"{codigo_turma}_Alunos"[:31]
                resultado['resumo_aluno'].to_excel(writer, sheet_name=nome_aba, index=False)

            if resultado['disciplinas_sem_nota']:
                nome_aba = f"{codigo_turma}_SemNota"[:31]
                df_sem_nota = pd.DataFrame({'Disciplinas sem Nota': resultado['disciplinas_sem_nota']})
                df_sem_nota.to_excel(writer, sheet_name=nome_aba, index=False)

    output.seek(0)
    wb = load_workbook(output)
    for ws in wb.worksheets:
        # Extrai o código da turma do nome da aba
        codigo_turma = ws.title.split('_')[0]
        inserir_titulo(ws, f"Turma: {codigo_turma}")
        ajustar_largura_colunas(ws)

    output2 = BytesIO()
    wb.save(output2)
    output2.seek(0)
    return output2

def montar_consolidado(resultados_turmas):
    """
    Monta um DataFrame consolidado com disciplinas nas linhas e turmas nas colunas,
    mostrando a quantidade de alunos com notas baixas (<6) por disciplina em cada turma.
    """
    # DataFrame vazio para armazenar o consolidado
    df_consolidado = pd.DataFrame()

    # Para cada turma processada
    for resultado in resultados_turmas:
        codigo_turma = resultado['codigo_turma']
        resumo_disciplina = resultado['resumo_disciplina']

        # Se a turma foi processada com sucesso
        if resumo_disciplina is not None:
            # Cria uma série com disciplinas como índice e quantidade de alunos com nota baixa como valores
            serie_turma = resumo_disciplina.set_index('Disciplina')['Alunos com nota < 6']

            # Adiciona a série como uma nova coluna no DataFrame consolidado
            df_consolidado[codigo_turma] = serie_turma

    # Preenche valores ausentes com 0 (disciplinas que não existem em algumas turmas)
    df_consolidado = df_consolidado.fillna(0)

    # Converte para inteiros (remove decimais desnecessários)
    df_consolidado = df_consolidado.astype(int)

    # Ordena as disciplinas alfabeticamente
    df_consolidado = df_consolidado.sort_index()

    # Adiciona uma coluna "Total" com a soma de todas as turmas
    df_consolidado['TOTAL'] = df_consolidado.sum(axis=1)

    return df_consolidado

def gerar_excel_consolidado(df_consolidado):
    """Gera um arquivo Excel apenas com o relatório consolidado"""
    output = BytesIO()

    with pd.ExcelWriter(output, engine='openpyxl') as writer:
        df_consolidado.to_excel(writer, sheet_name='Consolidado', index=True)

    output.seek(0)

    # Ajusta largura das colunas
    wb = load_workbook(output)
    ws = wb['Consolidado']

    # Adiciona título
    ws.insert_rows(1)
    ws['A1'] = 'RELATÓRIO CONSOLIDADO - ALUNOS COM NOTAS BAIXAS POR DISCIPLINA'
    ws['A1'].font = Font(bold=True, size=14)
    ws['A1'].alignment = Alignment(horizontal='center')
    ws.merge_cells(start_row=1, start_column=1, end_row=1, end_column=ws.max_column)

    # Ajusta largura das colunas
    ajustar_largura_colunas(ws)

    output2 = BytesIO()
    wb.save(output2)
    output2.seek(0)
    return output2

def main():
    st.set_page_config(
        page_title="Relatórios EJF",
        page_icon="📊",
    )
    
    logo_base64 = "data:image/png;base64,"
    
    st.markdown(
    f"""
    <div style='margin-top: -30px; display: flex; flex-direction: column; align-items: center;'>
        <img src='{logo_base64}' width='64'/>
        <h5 style='color: #61efff; margin-top: 10px;'>
            ESCOLA ESTADUAL PROF. JOSÉ FÉLIX DE CARVALHO ALVES
        </h5>
        <h1 style='margin-bottom: 18px'>📊 Processador de Relatórios</h1>
    </div>
    """,
    unsafe_allow_html=True
    )
    st.write("Faça upload de um ou mais relatórios de notas para análise automática. Funciona somente para o relatório 'Mapa Geral de Notas' do Sigeduc, em formato Excel (.xls ou .xlsx).")

    arquivos_upload = st.file_uploader(
        "Arraste e solte os arquivos aqui ou clique em 'Browse files' para selecionar os relatórios.",
        type=["xls", "xlsx"],
        accept_multiple_files=True,
        help="Selecione um ou mais arquivos de relatório baixados do sistema da escola"
    )

    if arquivos_upload:
        st.write(f"📁 **{len(arquivos_upload)} arquivo(s) carregado(s)**")

        # Processar todos os arquivos
        resultados_turmas = []

        with st.spinner("🔄 Processando todos os arquivos..."):
            for arquivo_upload in arquivos_upload:
                resultado = processar_arquivo(arquivo_upload)
                resultados_turmas.append(resultado)

        # Exibir resultados para cada turma
        for i, resultado in enumerate(resultados_turmas):
            st.divider()

            # Título da turma
            st.subheader(f"🏫 Turma: {resultado['codigo_turma']}")
            st.caption(f"Arquivo: {resultado['arquivo_nome']}")

            # Verificar se houve erros
            if any(erro for erro in resultado['erros'] if erro):
                st.error("❌ Erro ao processar este arquivo")
                for erro in resultado['erros']:
                    if erro:
                        st.write(f"• {erro}")
                continue

            # Mostrar resumo por disciplina
            if resultado['resumo_disciplina'] is not None:
                st.write("**📈 Resumo por Disciplina**")
                st.dataframe(resultado['resumo_disciplina'], use_container_width=True)

            # Mostrar resumo por aluno
            if resultado['resumo_aluno'] is not None:
                st.write("**👥 Resumo por Aluno**")
                st.dataframe(resultado['resumo_aluno'], use_container_width=True)

            # Mostrar disciplinas sem nota
            if resultado['disciplinas_sem_nota']:
                st.write("**⚠️ Disciplinas sem Nota no 1º Bimestre**")
                for disc in resultado['disciplinas_sem_nota']:
                    st.write(f"• {disc}")
            else:
                st.success("✅ Todas as disciplinas têm nota no 1º bimestre")

        # Botão de download para todas as turmas
        if resultados_turmas and any(r['resumo_disciplina'] is not None for r in resultados_turmas):
            st.divider()
            st.subheader("📥 Download do Relatório Completo")

            excel_file = criar_excel_multiplas_turmas(resultados_turmas)

            # Nome do arquivo com todas as turmas
            codigos_turmas = [r['codigo_turma'] for r in resultados_turmas if r['resumo_disciplina'] is not None]
            nome_arquivo = f"relatorio_completo_{len(codigos_turmas)}_turmas.xlsx"

            st.download_button(
                label=f"📥 Baixar Relatório de Todas as Turmas ({len(codigos_turmas)} turmas)",
                data=excel_file,
                file_name=nome_arquivo,
                mime="application/vnd.openxmlformats-officedocument.spreadsheetml.sheet"
            )

            st.info(f"💡 O arquivo Excel conterá abas separadas para cada turma: {', '.join(codigos_turmas)}")

        if st.button("📊 Gerar Relatório Consolidado"):
            df_consolidado = montar_consolidado(resultados_turmas)
            st.dataframe(df_consolidado)

            excel_cons = gerar_excel_consolidado(df_consolidado)  # função curta que grava 1 aba
            st.download_button("📥 Baixar Consolidado", data=excel_cons, file_name="consolidado.xlsx",
                            mime="application/vnd.openxmlformats-officedocument.spreadsheetml.sheet")
            
            st.info(f"💡 Este relatório junta em uma tabela as quantidades de alunos com notas baixas de todas as turmas processadas: {', '.join(codigos_turmas)}")
            
if __name__ == "__main__":
    main()